import React, { useEffect, useState, useMemo } from 'react';
import ItemList from '../../components/listItems';
import GetIssues from "../../services/getIssues";


function IssuesPage({page}){
    const [issues, setIssue] = useState([]);
    const newdata = {
        items: issues,
        card: "issues"
    };

    useEffect(function(){
        GetIssues({page}).then(issues => setIssue(issues))
    },[issues])

    console.log(issues);
    return(
        <div>
            <ItemList data={newdata} />
        </div>
    );
}

export default IssuesPage;
